sys_variable_value.value:
(function execute(inputs, outputs) {
  switch(inputs.operation){
    case 'create':
      	var set = new ImportSetUtils().createImportSet(inputs.importsettable,inputs.subflowname);
  		outputs.set = set;
      	break;
    case 'update':
        new ImportSetUtils().updateImportSet(inputs.importsetsysid, inputs.state);
  		break;
    case 'transform':
      	new ImportSetUtils().transformImportSet(inputs.importsetsysid);
  		break;
    case 'getimportsetrunstatus':
      	var importSetRunstatus = new ImportSetUtils().getImportSetRunStatus(inputs.importsetsysid);
        outputs.importsetrunstatus = importSetRunstatus;
  		break;
  }

})(inputs, outputs);

